import React from "react";
import Header from "./components/layouts/Header";
import Footer from "./components/layouts/Footer";


function AdminHome() {
  const stylling= {
    background: "rgb(12,237,26)",
    background: "linear-gradient(90deg, rgba(12,237,26,1) 0%, rgba(115,223,10,0.6730042358740371) 22%, rgba(39,249,5,0.16880255520176823) 100%, rgba(1,255,0,1) 100%)"
    
    };
    return (
        <>
        <Header/>
        <div className='aa container-fluid' style={stylling}>
          <h3>Search By Teams/Refree/Venues</h3>
          <br/>
            <div class="input-group">
                <input type="search" class="form-control rounded" placeholder="Search" aria-label="Search" aria-describedby="search-addon" />
                <button type="button" class="btn btn-outline-primary">search</button>
            </div>
        </div>
        <Footer/>
        </>
    );
  }
  
  export default AdminHome;
